import s from './Components/StyleApp/app.module.css'
import {BrowserRouter, Route} from 'react-router-dom';
import Profile from "./Components/Profile/Profile";
import Header from "./Components/Header/Header";
import Footer from "./Components/Footer/Footer";
import About from "./Components/About/About";
import AllOrderContainer from "./Components/Orders/AllOreder/AllOrderContainer";
import SliderItemContainer from "./Components/SliderItem/SliderItemContainers";
import BuyContainer from "./Components/Buy/BuyContainer";
import Checkout from "./Components/Checkout/Checkout";
import {withSuspense} from "./hoc/Suspense";


function App(props) {
    return (
        <BrowserRouter path="/profile">
            <div className={s.App}>
                <Header/>

                <Route path="/about" render={withSuspense(<About/>)}/>

                <Route path="/profile" render={() => <Profile/>}/>

                <Route path="/items/:id" render={withSuspense(<AllOrderContainer/> || <SliderItemContainer/>)}/>

                <Route path="/buy" render={withSuspense(<BuyContainer/>)}/>

                <Route path="/checkout" render={withSuspense(<Checkout/>)}/>


                <Footer/>
            </div>
        </BrowserRouter>

    );
}

export default App;
